import Axios from 'axios';
import React from 'react';
import Profile from './Profile.jsx'



class ProfileContainer extends React.Component {

  componentDidMount() {
    Axios.get
  }

  render() {
    return (
      <Profile {...this.props} />
    )
  }
}


export default ProfileContainer;
